    return(
        <section className="aem-Grid aem-Grid--12">
            
            {props.data.map((prod) => {
                return (
                    <>
            <div  key={prod.id} className="aem-GridColumn aem-GridColumn--default--6 aem-GridColumn--phone--12 aem-GridColumn--tablet--12 aem-Grid aem-Grid--12">
            <img src={prod.image} alt={prod.title}/>
            </div>
            <div className="aem-GridColumn aem-GridColumn--default--6 aem-GridColumn--phone--12 aem-GridColumn--tablet--12">

            </div>
            </>
                );
            })
        }
        

        </section>
    );
}
